    const DriverDelivery = () => {
        return(
            <div>
                Driver

            </div>
        )
    }


    const UserDelivery = () => {
        return(
            <div>
                User
            </div>
        )
    }

    return (
        <div className="deliveries">
            {
                userType === 0 ?
                <UserDelivery/>
                :
                <DriverDelivery/>
            }
        </div>
  )
}
